interface UberDuckVoiceItem {
  value: UberDuckVoice
  name: string
}

export const UberDuckVoices: UberDuckVoiceItem[] = voicesJson.reduce(
  (arr, voiceData) => {
    if (!voiceData.is_private)
      arr.push({ name: voiceData.display_name, value: voiceData.name })
    return arr
  },
  [] as UberDuckVoiceItem[]
)
